import React from 'react';

const Landing = () => {
    return (
        <section className="container">
    <header>
      <h2 className="logo text-light ">Gyminspiration</h2>
    
    </header>
  
        

    <div className="overlay"></div>
    <div className="text mt-5">
      <h2> The people think of wealth and power as the greatest fate, But in this world a spell of health is the best state. </h2> 
    
      <p>Stress in moderation is a good and healthy thing - that means you are on the right track; its when that stress turns into the things that prevent you from doing what you love, that is when it becomes a problem..</p>
      <h1><a className="bg-danger rounded">Coming Soon</a><br/>
      </h1>
      <h3><a className="bg-warning rounded">Stay Tuned</a>
      </h3>
    </div>
   </section>
      );
}
 
export default Landing;
